    [],nt"num_tags": 0,nt"name": "channel-islands-kelp-forest-monitoring-survey-band-transect",nt"isopen":
    false,nt"url": null,nt"notes": "This dataset from the Channel Islands National
    Park's Kelp Forest Monitoring Program has measurements of the abundance and distribution
    of rare and clumped organisms not adequately sampled by quadrats. The summary data
    presented here represents the mean density per square meter. Sampling is conducted
    annually between the months of May-October, so the Time data in this file is July
    1 of each year (a nominal value). The actual measurements were taken at various
    depths, so the Depth data in this file is the depth of the station's temperature
    logger, which is a typical depth.",nt"owner_org": "e811f0b4-451f-4896-9e8f-fc6802837819",nt"extras":
